import React from 'react';
import Profile from './Profile/Profile';
import user from '../user.json';
import Statistics from './Statistics/Statistics'

 const App = () => (
    <>
    <Profile 
    name = {user.name}
    tag = {user.tag}
    location = {user.location}
    avatar = {user.avatar} 
    stats = {user.stats}
    />
    <Statistics
    
    />
    </>
    

);

export default App;
